import React from 'react';
import kona from '../img/kona.jpg'

const Card = () => {
	return(
		<div className="ma3 ba pa3">
			<img src={kona} alt="kona"/>
			<h2>TITLE</h2>
			<p> small description </p>
		</div>
	);
};

export default Card;
